  render() {
    const { classes } = this.props;
    var value = this.state.value;
    // console.log(value);
    return (
      <div className={classes.root}>
        <Grid container spacing={3}>
          <Grid item xs={5}>
            <Paper className={classes.paper}>
              <ListItem>
                <Avatar
                  src={"https://upload.wikimedia.org/wikipedia/commons/0/01/Bill_Gates_July_2014.jpg"}>
                </Avatar>

                <span style={{ padding: 20 }}>
                  <div><b>Awosome Project</b></div>
                  <div style={{ fontSize: 12 }}>@user </div>
                </span>

              </ListItem>

              <div style={{ paddingLeft: '2%' }}>
                <span>Dance party, Bergahin, Berlin</span><br/>
                <span>@ 01:00 AM</span>
                <p>&nbsp;</p>
              </div>

            </Paper>
          </Grid>
          <Grid item xs={5}>
            <Paper className={classes.paper}>
              <ListItem>
                <Avatar
                  src={"https://upload.wikimedia.org/wikipedia/commons/0/01/Bill_Gates_July_2014.jpg"}>
                </Avatar>

                <span style={{ padding: 20 }}>
                  <div><b>Awosome Project</b></div>
                  <div style={{ fontSize: 12 }}>@user </div>
                </span>

              </ListItem>

              <div style={{ paddingLeft: '2%' }}>
                <span>Dance party, Bergahin, Berlin</span><br/>
                <span>@ 01:00 AM</span>
                <p>&nbsp;</p>
              </div>

            </Paper>
          </Grid>

          <Grid item xs={12}>
            <center>
            <button className="eventBtn">This Week</button>
            <button className="eventBtn">This Month</button>
            <button className="eventBtn">Next Month</button>
            </center>
          </Grid>
          <Grid item xs={10}>
            <button className="eventBtnl">Event Invitations</button>
          </Grid>
          <Grid item xs={10}>
            <button className="eventBtnl">Past Invitations</button>
          </Grid>
          <Grid item xs={5}>
            <Paper className={classes.paper}>
              <ListItem>
                <Avatar
                  src={"https://upload.wikimedia.org/wikipedia/commons/0/01/Bill_Gates_July_2014.jpg"}>
                </Avatar>

                <span style={{ padding: 20 }}>
                  <div><b>Awosome Project</b></div>
                  <div style={{ fontSize: 12 }}>@user </div>
                </span>

              </ListItem>

              <div style={{ paddingLeft: '2%' }}>
                <span>Dance party, Bergahin, Berlin</span><br/>
                <span>@ 01:00 AM</span>
                <p>&nbsp;</p>
              </div>

            </Paper>
          </Grid>
          <Grid item xs={5}>
            <Paper className={classes.paper}>
              <ListItem>
                <Avatar
                  src={"https://upload.wikimedia.org/wikipedia/commons/0/01/Bill_Gates_July_2014.jpg"}>
                </Avatar>

                <span style={{ padding: 20 }}>
                  <div><b>Awosome Project</b></div>
                  <div style={{ fontSize: 12 }}>@user </div>
                </span>

              </ListItem>

              <div style={{ paddingLeft: '2%' }}>
                <span>Dance party, Bergahin, Berlin</span><br/>
                <span>@ 01:00 AM</span>
                <p>&nbsp;</p>
              </div>

            </Paper>
          </Grid>
        </Grid>
      </div>
    );
  }
}

Event.propTypes = {
  children: PropTypes.node.isRequired,
};

export default withStyles(styles)(Event);
